import React from 'react';
import './styles.css';

const topPart = {
    margin: "100px"
}

const headline = {
    fontSize: "50px",
}

const subheader = {
    fontSize: "25px",
}

const description = {
    backgroundColor: "#0074D9",
    width: "100%",
    height: "800px",
}

export default function Frontpage() {
    return (
        <div className="Body">
            <div style={topPart}>
                <h1 style={headline}>Front-end developer, biologist</h1>
                <i style={subheader}>I design and code awesome stuff, and I love what I do!</i>
            </div>
            <div style={description}>
                <code>I'm a passionated developer that aims to make beautiful yet usefull products</code>
            </div>
        </div>

    )
}
